import Hero from "../components/Hero";
import Navbar from "../components/Navbar";
import homeimage from "../assests/homeimage.jpg";

function Contact(){
    return(
     <>
        <Navbar/>
    <Hero
    cName ="hero-mid"
    heroImage ={homeimage}
    title ="FOR MORE INFORMATION"
    
    />
     </>
    )
 }
 
 
 export default Contact;
